import React from "react";

function ItemCard({ item }) {
  return (
    <div>
      <div
        className="item"
        style={{
          width: 128,
          height: 188,
          backgroundImage: `url(${item.img_url})`
        }}
      ></div>
    </div>
  );
}
export default ItemCard;
